import React from 'react';
import { styled } from '@mui/material/styles';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import FacebookIcon from '@mui/icons-material/Facebook'
// import LinkedInIcon from '@mui/icons-material/LinkedIn';
import { IconButton } from '@mui/material';
import TextBox from '../components/small-components/TextBox';


const RootContainer = styled(Container)(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  paddingTop: theme.spacing(10),
  paddingBottom: theme.spacing(10),
}));

const FormContainer = styled('form')(({ theme }) => ({
  display: 'flex',
  flexDirection: 'column',
  alignItems: 'center',
  width: '100%',
  marginTop: theme.spacing(2),
  marginBottom: theme.spacing(2),
}));

const ButtonWrapper = styled(Button)(({ theme }) => ({
  margin: theme.spacing(2),
}));

const SocialButtonsContainer = styled('div')(({ theme }) => ({
  display: 'flex',
  justifyContent: 'center',
  marginTop: theme.spacing(2),
}));

const SocialButtonWrapper = styled(IconButton)(({ theme }) => ({
  margin: theme.spacing(1),
}));

const SignUpLink = styled('a')(({ theme }) => ({
  marginTop: theme.spacing(2),
}));

const SignUpPage = () => {
  return (
    <RootContainer maxWidth="sm">
      <FormContainer>
        <TextBox title="Username" placeholder="Enter your username" />
        <TextBox title="Password" placeholder="Enter your password" />
        <ButtonWrapper variant="contained" color="primary">
          Sign in with Google
        </ButtonWrapper>
        <SocialButtonsContainer>
          <SocialButtonWrapper color="primary">
            <FacebookIcon />
          </SocialButtonWrapper>
          {/* <SocialButtonWrapper color="primary">
            <LinkedInIcon />
          </SocialButtonWrapper> */}
        </SocialButtonsContainer>
        <SignUpLink href="#">SignUp!</SignUpLink>
      </FormContainer>
    </RootContainer>
  );
};

export default SignUpPage;
